import React from 'react';
import logo from '../images/logo.png'
import {Container,Row} from 'react-bootstrap';
const Header = () => {
    return(
        <header>
            <Container>
            <Row>
            <div class="col-md-3">
            <div class="main-logo">
              <img src={logo} className="App-logo" alt="logo" />
            </div>
          </div>
            </Row>
            </Container>
        </header>
    )
}

export default Header;
